import { Container } from 'react-bootstrap';
import './App.css';
import Footer from './components/Footer';
import NavBar from './components/NavBar';
import HomePage from './pages/Home';

function App() {
  return (
    <>
      <NavBar />
      <Container classname="mt-4">
        <h1>E-Mart</h1>
        <HomePage />
      </Container>
      <Footer />
    </>
  );
}

export default App;
